import React from 'react';

class GoogleAuth extends React.Component {
    componentDidMount(){
        window.gapi.load('client:auth2', () => {  //this is only available on window scope
            window.gapi.client.init({
                clientId: '431555564958-pqko7mtqu4jei9ipo5go0dfnu8e0471m.apps.googleusercontent.com',
                scope: 'email'
            })
        });  
    }

    render() {
        return (
        <div>
            GoogleAuth
        </div>
        )
    }
}

export default GoogleAuth;
